-- ===== LOGIC =====
local walking = false
local currentTween

local function moveAlongPath()
	for _, cf in ipairs(Path) do
		if not walking then break end
		local distance = (hrp.Position - cf.Position).Magnitude
		local tweenInfo = TweenInfo.new(distance / (10 * selectedSpeed), Enum.EasingStyle.Linear)
		currentTween = tweenService:Create(hrp, tweenInfo, {CFrame = cf})
		currentTween:Play()
		currentTween.Completed:Wait()
	end
end

startButton.MouseButton1Click:Connect(function()
	if walking then return end
	walking = true
	startButton.Text = "‚ñ∂ Running..."
	moveAlongPath()
	walking = false
	startButton.Text = "‚ñ∂ Start Auto"
end)

stopButton.MouseButton1Click:Connect(function()
	if currentTween then currentTween:Cancel() end
	walking = false
	startButton.Text = "‚ñ∂ Start Auto"
end)
